import React, {
    Fragment
} from 'react';
import Home from './Pages/Home';
import {
    BrowserRouter as Router,
    Route,
    Link,
    Switch,
    Redirect
} from 'react-router-dom';
import {
    Category
} from './Pages/Category';
import AllProducts from './Pages/AllProducts';
import {
    ProductDescription
} from './Pages/ProductDescription';
import {
    OrderSummary
} from './Pages/OrderSummary';
import {
    AboutSeller
} from './Pages/AboutSeller';
import {
    Variants
} from './Pages/Variants';
import {
    Specifications
} from './Pages/Specifications';
import {
    EmiOptions
} from './Pages/EmiOptions';
import {
    OnePageCheckout
} from './Pages/OnePageCheckout';
import {
    Login
} from './Pages/Login';
import {
    Otp
} from './Pages/Otp';
import {
    SignIn
} from './Pages/SignIn';
import {
    SignUp
} from './Pages/SignUp';
import {
    Review
} from './Pages/Review';
import {
    Allreview
} from "./Pages/Allreview";
import {
    Emptycart
} from "./Pages/Emptycart";
import {
    Transactionerror
} from "./Pages/Transactionerror";
import {
    Orderplaced
} from "./Pages/Orderplaced";
import {
    Cart
} from "./Pages/Cart";
import {
    Address
} from "./Pages/Address";
import {
    CheckoutPage
} from "./Pages/CheckoutPage";
import {
    FlashSalePage
} from "./Pages/FlashSalePage";
import {
    CustomerAddress
} from "./Pages/CustomerAddress";
import {
    Account
} from "./Pages/Account";
import {
    Password
} from "./Pages/Password";
import {
    Wallet
} from "./Pages/Wallet";
import {
    Profile
} from "./Pages/Profile";
import {
    Wishlist
} from "./Pages/Wishlist"
import {
    EmptyWishlist
} from "./Pages/EmptyWishlist"
import {
    OrdersList
} from "./Pages/OrdersList"
import {
    OrderDetails
} from "./Pages/OrderDetails";
import {
    SubmitReview
} from "./Pages/SubmitReview";
import {
    CancellationRequest
} from "./Pages/CancellationRequest";
import {
    CancellationConfirmed
} from "./Pages/CancellationConfirmed";
import {
    SupportCenterIssues
} from "./Pages/SupportCenterIssues";
import {
    SupportCenter
} from "./Pages/SupportCenter";
import {
    ReturnRequest
} from "./Pages/ReturnRequest";
import {
    ContactUs
} from "./Pages/ContactUs";
import {
    Blog
} from "./Pages/Blog";
import {
    BlogName
} from "./Pages/BlogName";
import {
    PrivacyPolicy
} from "./Pages/PrivacyPolicy";
import {
    SupportCenterQueries
} from "./Pages/SupportCenterQueries";
import {
    Career
} from "./Pages/Career";
import {
    BusinessIntelligence
} from "./Pages/BusinessIntelligence";
import {
    ReferAFriend
} from "./Pages/ReferAFriend";
import {
    ReferAFriendDetails
} from "./Pages/ReferAFriendDetails";
import useHeaderChange from './utils/global-functions/use-Header-change';

export const Layout = () => {
    return ( <
        div >
        <
        useHeaderChange / >
        <
        Router >
        <
        Switch >
        <
        Redirect exact from = '/'
        to = '/home' / >
        <
        Route path = '/home'
        component = {
            Home
        }
        /> <
        Route exact path = '/category'
        component = {
            Category
        }
        /> <
        Route exact path = '/allproducts'
        component = {
            AllProducts
        }
        /> <
        Route exact path = '/productdescription'
        component = {
            ProductDescription
        }
        /> <
        Route exact path = '/aboutseller'
        component = {
            AboutSeller
        }
        /> <
        Route exact path = '/productvariants'
        component = {
            Variants
        }
        /> <
        Route exact path = '/productspecifications'
        component = {
            Specifications
        }
        /> <
        Route exact path = '/ordersummary'
        component = {
            OrderSummary
        }
        /> <
        Route exact path = '/emioptions'
        component = {
            EmiOptions
        }
        /> <
        Route exact path = '/onepagecheckout'
        component = {
            OnePageCheckout
        }
        /> <
        Route exact path = '/login'
        component = {
            Login
        }
        /> <
        Route exact path = '/Otp'
        component = {
            Otp
        }
        /> <
        Route exact path = '/SignIn'
        component = {
            SignIn
        }
        /> <
        Route exact path = '/signup'
        component = {
            SignUp
        }
        /> <
        Route exact path = '/review'
        component = {
            Review
        }
        /> <
        Route exact path = '/Allreview'
        component = {
            Allreview
        }
        /> <
        Route exact path = '/Emptycart'
        component = {
            Emptycart
        }
        /> <
        Route exact path = '/Transactionerror'
        component = {
            Transactionerror
        }
        /> <
        Route exact path = '/Orderplaced'
        component = {
            Orderplaced
        }
        /> <
        Route exact path = '/Cart'
        component = {
            Cart
        }
        /> <
        Route exact path = '/address'
        component = {
            Address
        }
        /> <
        Route exact path = '/checkoutpage'
        component = {
            CheckoutPage
        }
        /> <
        Route exact path = '/flashsale'
        component = {
            FlashSalePage
        }
        /> <
        Route exact path = '/customeraddress'
        component = {
            CustomerAddress
        }
        /> <
        Route exact path = '/account'
        component = {
            Account
        }
        /> <
        Route exact path = '/changepassword'
        component = {
            Password
        }
        /> <
        Route exact path = '/wallet'
        component = {
            Wallet
        }
        /> <
        Route exact path = '/profile'
        component = {
            Profile
        }
        /> <
        Route exact path = '/wishlist'
        component = {
            Wishlist
        }
        /> <
        Route exact path = '/emptywishlist'
        component = {
            EmptyWishlist
        }
        /> <
        Route exact path = '/orderslist'
        component = {
            OrdersList
        }
        /> <
        Route exact path = '/orderdetails'
        component = {
            OrderDetails
        }
        /> <
        Route exact path = '/submitreview'
        component = {
            SubmitReview
        }
        /> <
        Route exact path = '/cancellationrequest'
        component = {
            CancellationRequest
        }
        /> <
        Route exact path = '/cancellationconfirmed'
        component = {
            CancellationConfirmed
        }
        /> <
        Route exact path = '/supportcenterissues'
        component = {
            SupportCenterIssues
        }
        /> <
        Route exact path = '/supportcenter'
        component = {
            SupportCenter
        }
        /> <
        Route exact path = '/returnrequest'
        component = {
            ReturnRequest
        }
        /> <
        Route exact path = '/contactus'
        component = {
            ContactUs
        }
        /> <
        Route exact path = '/supportcenterqueries'
        component = {
            SupportCenterQueries
        }
        /> <
        Route exact path = '/blogname'
        component = {
            BlogName
        }
        /> <
        Route exact path = '/blog'
        component = {
            Blog
        }
        /> <
        Route exact path = '/privacypolicy'
        component = {
            PrivacyPolicy
        }
        /> <
        Route exact path = '/career'
        component = {
            Career
        }
        /> <
        Route exact path = '/businessintelligence'
        component = {
            BusinessIntelligence
        }
        /> <
        Route exact path = '/referafriend'
        component = {
            ReferAFriend
        }
        /> <
        Route exact path = '/referafrienddetails'
        component = {
            ReferAFriendDetails
        }
        /> <
        /Switch> <
        /Router> <
        /div>
    );
};
